const domain =
  process.env.REACT_APP_ENV !== "prod"
    ? "http://localhost:9302"
    : "https://api-gateway.weatherplus.vn";
const domainHome =
  process.env.REACT_APP_ENV !== "prod"
    ? "https://dev.metplus.vn"
    : "https://metplus.vn";

const baseURL = `${domain}/api`;
const accessTokenKey = "jwt_access_token";
const refreshTokenKey = "jwt_refresh_token";
const rememberUsername = "remembered_username";
const rememberPassword = "remembered_password";

const preFixUrlFile =
  process.env.REACT_APP_ENV !== "prod"
    ? "https://api-gateway-dev.weatherplus.vn/model-forecast/api/guest/public"
    : "https://api-gateway.weatherplus.vn/model-forecast/api/guest/public";
const apiConfig = {
  baseURL,
  accessTokenKey,
  refreshTokenKey,
  domainHome,
  preFixUrlFile,
  rememberUsername,
  rememberPassword,
};

export default apiConfig;
